import React, { Component } from 'react';
import { ReactComponent as PlusIcon } from './add.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="app">
          <div className="appWrapper">
            <h1 className="appTitle">Task Manager</h1>
              <div className="listWrapper">
                  <h1 className="listTitle">Work</h1>
                  <div className="taskInputWrapper">
                      <PlusIcon className="plusSign" />
                      <input type="text" className="taskInput" placeholder="Add new task" />
                      <div className="addBtn">Add</div>
                  </div>
              </div>
          </div>
      </div>
    );
  }
}

export default App;
